INSERT INTO `pages` (`id`, `name`, `content`, `user_id`, `image`, `template`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1, 'الصفحة الأمامية', '[hero-banner style=\"1\" title=\"داري سبيس للإستشارات  العقارية &lt;br&gt; هنساعدك في اختيار عقارك  المناسب\" title_highlight=\"عقارك\" subtitle=\"أكبر شركة استشارات عقارية تحتوي علي قاعدة بيانات أكثر من 300 مطور عقاري من أكبر المطورين العقاريين في مصر \" background_images=\"general/03.jpg,general/01.jpg,general/02.jpg,general/04.jpg\" enabled_search_box=\"1\" search_type=\"properties\" enabled_search_projects=\"1\"][/hero-banner][intro-about-us title=\"عن شركة داري سبيس \" description=\"داري سبيس هي شركة استشارات عقارية وتسويق عقاري توفر للمستخدمين جميع أنواع العقارات المناسبة حسب احتياجاتهم وميزانيتهم من خلال الشراكة مع أكبر المطوريين العقاريين في مصر، كما تهتم الشركة بالمعايير التي تضمن حق العميل وتوفر له كافة الضمانات والشروط التي تضمين حقوقه المالية ، كما توفر الشركة قسم خاص لأصحاب العقارات والمكاتب العقارية للإعلان عن عقاراتهم للبيع أو للإيجار من خلال موقع وتطبيق داري سبيس . \" text_button_action=\"إقرأ أكثر \" url_button_action=\"#\" image=\"general/about.jpg\" youtube_video_url=\"https://www.youtube.com/watch?v=y9j-BL5ocW8\"][/intro-about-us][how-it-works title=\"How It Works\" subtitle=\"A great platform to buy, sell and rent your properties without any agent or commissions.\" icon_1=\"mdi mdi-home-outline\" title_1=\"Evaluate Property\" description_1=\"If the distribution of letters and \'words\' is random, the reader will not be distracted from making.\" icon_2=\"mdi mdi-bag-personal-outline\" title_2=\"Meeting with Agent\" description_2=\"If the distribution of letters and \'words\' is random, the reader will not be distracted from making.\" icon_3=\"mdi mdi-key-outline\" title_3=\"Close the Deal\" description_3=\"If the distribution of letters and \'words\' is random, the reader will not be distracted from making.\"][/how-it-works][properties-by-locations title=\"Find your inspiration with Hously\" title_highlight_text=\"inspiration with\" subtitle=\"Properties By Location and Country\"][/properties-by-locations][featured-project