(19, 'Board Walk', 'تميز الموقع في وسط منطقة R7،  تقاطع الشارع الرئيسي(80 متر) الذي يقطع منطقة الR7 بالطول مع تقاطع الشارع الرئيسي (80 متر) الذي يقطع منطقة الR7 بالعرض.\r\n• المشروع يطول علي حدائق عامة مساحتها 6 فدان.\r\n• المشروع ضمن الاراضي الاسكان المتميز والتي يبلغ عددها 10 اراضي فقط في منطقة R7.\r\n• يقطع المشروع بالطول ممشي تجاري به جميع الخدمات من مطاعم، كافيهات، ممش', '<p>تميز الموقع في وسط منطقة R7، &nbsp;تقاطع الشارع الرئيسي(80 متر) الذي يقطع منطقة الR7 بالطول مع تقاطع الشارع الرئيسي (80 متر) الذي يقطع منطقة الR7 بالعرض.</p><p>• المشروع يطول علي حدائق عامة مساحتها 6 فدان.</p><p>• المشروع ضمن الاراضي الاسكان المتميز والتي يبلغ عددها 10 اراضي فقط في منطقة R7.</p><p>• يقطع المشروع بالطول ممشي تجاري به جميع الخدمات من مطاعم، كافيهات، ممشي للعجل و نافورة راقصة، فود كورت.</p><p>•عرض الممشي يصل إلي 80 متر.</p><p>• يقع المشروع في قلب منطقة ال R7و القريبة من المحاور الرئيسية مثل الدائري الاقليمي،شارع بن زايد الجنوبي، الكاتدرائية الجديدة، النهر الاخضر</p>', '{\"1\":\"general\\/sn8s7or65impcsf52khvjwdq8v139h1yreuqgvtk.jpg\"}', 'العاصمة الادارية', 48, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, 16, 'selling', NULL, 'Botble\\ACL\\Models\\User', '2023-04-01 05:30:20', '2023-04-01 05:37:53', NULL, NULL, 2, 7, 33),
(20, 'Boho', 'يوجد في منتجع بوهو السخنة حمامات سباحة على أعلى مستوى، لتوفير مساحة لمحبي السباحة في مناطق خاصة.\r\nيحتوي Resort BOHO El Sokhna على مساحات خضراء ومناظر طبيعية، حتى يتم توفير منظر جمالي لمحبي الراحة والرقي.\r\nتوفير خدمات الأمن والحراسة في منتجع بوهو العين السخنة، من أجل تحقيق الأمان بين السكان.\r\nيتضمن المنتجع أحدث كاميرات المراقبة', '<p>يوجد في منتجع بوهو السخنة حمامات سباحة على أعلى مستوى، لتوفير مساحة لمحبي السباحة في مناطق خاصة.<br>يحتوي Resort BOHO El Sokhna على مساحات خضراء ومناظر طبيعية، حتى يتم توفير منظر جمالي لمحبي الراحة والرقي.<br>توفير خدمات الأمن والحراسة في منتجع بوهو العين السخنة، من أجل تحقيق الأمان بين السكان.<br>يتضمن المنتجع أحدث كاميرات المراقبة، حتى يتم التقاط وتصوير كل شيء لزيادة الأمان بين السكان.<br>يشتمل المنتجع على منطقة تجارية، من أجل توفير كافة ما يحتاج إليها السكان وإجراء التسوق دون عناء.<br>يحتوي منتجع بوهو السخنة على أكوا بارك، يتوفر فيه كل الألعاب التي تناسب الأطفال.<br>توفير مساحات في Resort BOHO El Sokhna، من أجل ممارسة الرياضات المختلفة.<br>يشتمل منتجع بوهو العين السخنة على أماكن الاسترخاء، التي تساعد على تحقيق الرفاهية والاستجمام.<br>يتوفر في المنتجع منطقة مطاعم تحتوي على أشهر البراندات، من أجل توفير كل ما يحتاج إليه السكان</p>', '{\"1\":\"general\\/zavksa3np3kaafidg3oso7oljhgv2orvte0eto24.jpg\"}', 'السخنة', 48, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, 8, 'building', NULL, 'Botble\\ACL\\Models\\User', '2023-04-01 05:37:40', '2023-04-01 06:31:42', NULL, NULL, 3, 7, 33),
(21, 'Isola', 'Isola', '<p>Isola</p>', '{\"1\":\"general\\/properties-grid-01.jpg\"}', NULL, 63, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, 12, 'pre_sale', NULL, 'Botble\\ACL\\Models\\User', '2023-04-01 05:51:54', '2023-04-01 17:47:05', NULL, NULL, 1, 7, 33),
(22, 'Keeva', 'المشروع الوحيد اللي ع طريق دهشور كيلو ع الطريق\r\n5 دقايق من كل المحاور و مول العرب و مول مصر و جامعة النيل\r\n7 دقايق من مدينة الإنتاج الإعلامي و 30 دقيقة من وسط البلد\r\nبجوار بالم هيلز و سوان ليك حسن علام و ف اهم منطقة فيها اكبر المطورين', '<p>المشروع الوحيد اللي ع طريق دهشور كيلو ع الطريق</p><p>5 دقايق من كل المحاور و مول العرب و مول مصر و جامعة النيل</p><p>7 دقايق من مدينة الإنتاج الإعلامي و 30 دقيقة من وسط البلد</p><p>بجوار بالم هيلز و سوان ليك حسن علام و ف اهم منطقة فيها اكبر المطورين</p>', '{\"1\":\"general\\/properties-grid-01.jpg\"}', 'اكتوبر', 16, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, 12, 'sold', NULL, 'Botble\\ACL\\Models\\User', '2023-04-01 05:58:14', '2023-04-01 05:58:24', NULL, NULL, 0, 7, 33),
(23, 'Blumar Eldomeclub town', 'تتميز بلومار بتواجدها في مكان مميز على طريق مدينة الزعفرانة\r\nتتمتع بموقع مميز على ساحل البحر الأحمر وبالتحديد عند الكيلو 2\r\nيقع موقع القرية على مقربة من مدينة القاهرة بمسافة زمينة قدرها ساعة واحدة فقط\r\nتأتي على مقربة من قرية مارينا بمسافة 3 كيلو متر فقط', '<ul><li>تتميز بلومار بتواجدها في مكان مميز على طريق مدينة الزعفرانة</li><li>تتمتع بموقع مميز على ساحل البحر الأحمر وبالتحديد عند الكيلو 2</li><li>يقع موقع القرية على مقربة من مدينة القاهرة بمسافة زمينة قدرها ساعة واحدة فقط</li><li>تأتي على مقربة من قرية مارينا بمسافة 3 كيلو متر فقط</li><li>توفير قرية بلومار العين السخنة على مقربة من طريق السويس الذي من خلاله يمكنك الخروج إلى مدينة</li><li>يتمتع موقع القرية باحتوائه على شاطئ رملي بامتداد 350 متر</li></ul>', '{\"1\":\"general\\/zavksa3np3kaafidg3oso7oljhgv2orvte0eto24.jpg\"}', 'السخنة', 45, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, 8, 'selling', NULL, 'Botble\\ACL\\Models\\User', '2023-04-01 06:02:52', '2023-04-05 13:45:41', NULL, NULL, 2, 7, 33),
(24, 'Sephora Heights', 'Sephora Heights', '<ul><li>الموقع الاستراتيجي المميز للكمبوند جعله على مقربة من الجامعة الأمريكية وكذلك واحد من أرقى الشوارع وهو شارع التسعين، الذي يتميز بالحيوية مع وجود العديد من المباني والمعالم الهامة فيه كالجامعات والمدارس، بالإضافة إلى المولات التجارية وكذلك الترفيهية والإدارية.</li><li>طرح أسعار تنافسية ومناسبة لكافة العملاء، حيث يشمل سعر الوحدة كافة الخدمات والمزايا المقدمة، دون أي مصاريف إضافية أخرى.</li><li>يعد الاستلام الفوري للوحدة لن يحتاج العميل إلى الانتظار سنوات طويلة حتي يتمكن من تسلم وحدته، بل يمكنه تسلمها فورا لأنها مبنية بالفعل وتُتاح له الفرصة كاملة لاختيارها بحرية، ويمكنه البدء في تشطيبها في خلال عام واحد.</li><li>تقديم خدمات متميزة، تشمل: حمامات سباحة تم تخصيص واحد منها للسيدات فقط وهو مغطى، بالإضافة إلى مجمع للملاعب الرياضية، مول تجاري، نادي صحي يضم جيم وجاكوزي وسبا وسونا، فضلا عن وجود تراك للمشي، وكذلك مبنى اجتماعي.</li><li>تقديم خدمات أمن وحراسة على أعلى مستوى، وعلى مدار اليوم، الأمر الذي يساعد في الحفاظ على أمان وسلامة المتواجدين في كمبوند سيفورا هايتس.</li></ul>', '{\"1\":\"general\\/ankrqklsxa1lenou12y8kpsxo66gjs2wb0zbjnsy.webp\"}', 'التجمع', 108, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, 1, 15, 'building', NULL, 'Botble\\ACL\\Models\\User', '2023-04-01 06:06:11', '2023-04-05 12:40:51', NULL, NULL, 4, 7, 33);
INSERT INTO `re_projects_translations` (`lang_code`, `re_projects_id`, `name`, `description`, `content`, `location`) VALUES
('en_US', 19, 'Board Walk', 'تميز الموقع في وسط منطقة R7،  تقاطع الشارع الرئيسي(80 متر) الذي يقطع منطقة الR7 بالطول مع تقاطع الشارع الرئيسي (80 متر) الذي يقطع منطقة الR7 بالعرض.\r\n• المشروع يطول علي حدائق عامة مساحتها 6 فدان.\r\n• المشروع ضمن الاراضي الاسكان المتميز والتي يبلغ عددها 10 اراضي فقط في منطقة R7.\r\n• يقطع المشروع بالطول ممشي تجاري به جميع الخدمات من مطاعم، كافيهات، ممش', '<p>تميز الموقع في وسط منطقة R7، &nbsp;تقاطع الشارع الرئيسي(80 متر) الذي يقطع منطقة الR7 بالطول مع تقاطع الشارع الرئيسي (80 متر) الذي يقطع منطقة الR7 بالعرض.</p><p>• المشروع يطول علي حدائق عامة مساحتها 6 فدان.</p><p>• المشروع ضمن الاراضي الاسكان المتميز والتي يبلغ عددها 10 اراضي فقط في منطقة R7.</p><p>• يقطع المشروع بالطول ممشي تجاري به جميع الخدمات من مطاعم، كافيهات، ممشي للعجل و نافورة راقصة، فود كورت.</p><p>•عرض الممشي يصل إلي 80 متر.</p><p>• يقع المشروع في قلب منطقة ال R7و القريبة من المحاور الرئيسية مثل الدائري الاقليمي،شارع بن زايد الجنوبي، الكاتدرائية الجديدة، النهر الاخضر</p>', 'العاصمة الادارية'),
('en_US', 20, 'Boho', 'يوجد في منتجع بوهو السخنة حمامات سباحة على أعلى مستوى، لتوفير مساحة لمحبي السباحة في مناطق خاصة.\r\nيحتوي Resort BOHO El Sokhna على مساحات خضراء ومناظر طبيعية، حتى يتم توفير منظر جمالي لمحبي الراحة والرقي.\r\nتوفير خدمات الأمن والحراسة في منتجع بوهو العين السخنة، من أجل تحقيق الأمان بين السكان.\r\nيتضمن المنتجع أحدث كاميرات المراقبة', '<p>يوجد في منتجع بوهو السخنة حمامات سباحة على أعلى مستوى، لتوفير مساحة لمحبي السباحة في مناطق خاصة.<br>يحتوي Resort BOHO El Sokhna على مساحات خضراء ومناظر طبيعية، حتى يتم توفير منظر جمالي لمحبي الراحة والرقي.<br>توفير خدمات الأمن والحراسة في منتجع بوهو العين السخنة، من أجل تحقيق الأمان بين السكان.<br>يتضمن المنتجع أحدث كاميرات المراقبة، حتى يتم التقاط وتصوير كل شيء لزيادة الأمان بين السكان.<br>يشتمل المنتجع على منطقة تجارية، من أجل توفير كافة ما يحتاج إليها السكان وإجراء التسوق دون عناء.<br>يحتوي منتجع بوهو السخنة على أكوا بارك، يتوفر فيه كل الألعاب التي تناسب الأطفال.<br>توفير مساحات في Resort BOHO El Sokhna، من أجل ممارسة الرياضات المختلفة.<br>يشتمل منتجع بوهو العين السخنة على أماكن الاسترخاء، التي تساعد على تحقيق الرفاهية والاستجمام.<br>يتوفر في المنتجع منطقة مطاعم تحتوي على أشهر البراندات، من أجل توفير كل ما يحتاج إليه السكان</p>', 'السخنة'),
('en_US', 21, 'Isola', 'Isola', '<p>Isola</p>', NULL),
('en_US', 22, 'Keeva', 'المشروع الوحيد اللي ع طريق دهشور كيلو ع الطريق\r\n5 دقايق من كل المحاور و مول العرب و مول مصر و جامعة النيل\r\n7 دقايق من مدينة الإنتاج الإعلامي و 30 دقيقة من وسط البلد\r\nبجوار بالم هيلز و سوان ليك حسن علام و ف اهم منطقة فيها اكبر المطورين', '<p>المشروع الوحيد اللي ع طريق دهشور كيلو ع الطريق</p><p>5 دقايق من كل المحاور و مول العرب و مول مصر و جامعة النيل</p><p>7 دقايق من مدينة الإنتاج الإعلامي و 30 دقيقة من وسط البلد</p><p>بجوار بالم هيلز و سوان ليك حسن علام و ف اهم منطقة فيها اكبر المطورين</p>', 'اكتوبر'),
('en_US', 23, 'Blumar Eldomeclub town', 'تتميز بلومار بتواجدها في مكان مميز على طريق مدينة الزعفرانة\r\nتتمتع بموقع مميز على ساحل البحر الأحمر وبالتحديد عند الكيلو 2\r\nيقع موقع القرية على مقربة من مدينة القاهرة بمسافة زمينة قدرها ساعة واحدة فقط\r\nتأتي على مقربة من قرية مارينا بمسافة 3 كيلو متر فقط', '<ul><li>تتميز بلومار بتواجدها في مكان مميز على طريق مدينة الزعفرانة</li><li>تتمتع بموقع مميز على ساحل البحر الأحمر وبالتحديد عند الكيلو 2</li><li>يقع موقع القرية على مقربة من مدينة القاهرة بمسافة زمينة قدرها ساعة واحدة فقط</li><li>تأتي على مقربة من قرية مارينا بمسافة 3 كيلو متر فقط</li><li>توفير قرية بلومار العين السخنة على مقربة من طريق السويس الذي من خلاله يمكنك الخروج إلى مدينة</li><li>يتمتع موقع القرية باحتوائه على شاطئ رملي بامتداد 350 متر</li></ul>', 'السخنة'),
('en_US', 24, 'Sephora Heights', 'Sephora Heights', '<ul><li>الموقع الاستراتيجي المميز للكمبوند جعله على مقربة من الجامعة الأمريكية وكذلك واحد من أرقى الشوارع وهو شارع التسعين، الذي يتميز بالحيوية مع وجود العديد من المباني والمعالم الهامة فيه كالجامعات والمدارس، بالإضافة إلى المولات التجارية وكذلك الترفيهية والإدارية.</li><li>طرح أسعار تنافسية ومناسبة لكافة العملاء، حيث يشمل سعر الوحدة كافة الخدمات والمزايا المقدمة، دون أي مصاريف إضافية أخرى.</li><li>يعد الاستلام الفوري للوحدة لن يحتاج العميل إلى الانتظار سنوات طويلة حتي يتمكن من تسلم وحدته، بل يمكنه تسلمها فورا لأنها مبنية بالفعل وتُتاح له الفرصة كاملة لاختيارها بحرية، ويمكنه البدء في تشطيبها في خلال عام واحد.</li><li>تقديم خدمات متميزة، تشمل: حمامات سباحة تم تخصيص واحد منها للسيدات فقط وهو مغطى، بالإضافة إلى مجمع للملاعب الرياضية، مول تجاري، نادي صحي يضم جيم وجاكوزي وسبا وسونا، فضلا عن وجود تراك للمشي، وكذلك مبنى اجتماعي.</li><li>تقديم خدمات أمن وحراسة على أعلى مستوى، وعلى مدار اليوم، الأمر الذي يساعد في الحفاظ على أمان وسلامة المتواجدين في كمبوند سيفورا هايتس.</li></ul>', 'التجمع');
