(1900, 1, 'en', 'packages/optimize/optimize', 'collapse_white_space_description', 'This filter reduces bytes transmitted in an HTML file by removing unnecessary whitespace.', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
(1901, 1, 'en', 'packages/optimize/optimize', 'elide_attributes', 'Elide attributes', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
(1902, 1, 'en', 'packages/optimize/optimize', 'elide_attributes_description', 'This filter reduces the transfer size of HTML files by removing attributes from tags when the specified value is equal to the default value for that attribute. This can save a modest number of bytes, and may make the document more compressible by canonicalizing the affected tags.', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
