(1904, 1, 'en', 'packages/optimize/optimize', 'inline_css_description', 'This filter transforms the inline \"style\" attribute of tags into classes by moving the CSS to the header.', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
(1905, 1, 'en', 'packages/optimize/optimize', 'insert_dns_prefetch', 'Insert DNS prefetch', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
(1906, 1, 'en', 'packages/optimize/optimize', 'insert_dns_prefetch_description', 'This filter injects tags in the HEAD to enable the browser to do DNS prefetching.', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
(1907, 1, 'en', 'packages/optimize/optimize', 'remove_comments', 'Remove comments', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
(1908, 1, 'en', 'packages/optimize/optimize', 'remove_comments_description', 'This filter eliminates HTML, JS and CSS comments. The filter reduces the transfer size of HTML files by removing the comments. Depending on the HTML file, this filter can significantly reduce the number of bytes transmitted on the network.', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
(1909, 1, 'en', 'packages/optimize/optimize', 'remove_quotes', 'Remove quotes', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
(1910, 1, 'en', 'packages/optimize/optimize', 'remove_quotes_description', 'This filter eliminates unnecessary quotation marks from HTML attributes. While required by the various HTML specifications, browsers permit their omission when the value of an attribute is composed of a certain subset of characters (alphanumerics and some punctuation characters).', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
(1911, 1, 'en', 'packages/optimize/optimize', 'defer_javascript', 'Defer javascript', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
(1912, 1, 'en', 'packages/optimize/optimize', 'defer_javascript_description', 'Defers the execution of javascript in the HTML. If necessary cancel deferring in some script, use data-pagespeed-no-defer as script attribute to cancel deferring.', '2023-03-05 23:53:49', '2023-03-05 23:53:49'),
